import React from 'react'
import './styles/App.css'
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Link
} from "react-router-dom";
import About from './pages/About';

function App() {
  return (

    <Router>
      <div>


        <Routes>
          <Route path="/about">
            <About />
          </Route>
        </Routes>
      </div>
    </Router>
  )

}

export default App;
